import React from 'react';
import { Nav, Navbar, NavbarBrand, NavLink, FormControl, Form, Button} from 'react-bootstrap';

function MyNav() {
    return (
        <div>
 <Navbar bg="light" variant="light">
 <Navbar.Brand href="#home">Shop Smart</Navbar.Brand>
 <Nav className="mr-auto">
   <Nav.Link href="#home">Electronics</Nav.Link>
   <Nav.Link href="#features">Health and Wellness</Nav.Link>
   <Nav.Link href="#pricing">Beauty and Cosmetics</Nav.Link>
 </Nav>
 <Form inline>
   <FormControl type="text" placeholder="Search" className="mr-sm-2" />
   <Button variant="outline-primary">Search</Button>
 </Form>
</Navbar>
</div>
    )
}

export default MyNav;
